      "url": "https://raw.githubusercontent.com/chainjet/assets/master/integrations/aws/Arch_AWS-WorkLink_64.svg"
    },
    "termsOfService": "https://aws.amazon.com/service-terms/",
    "contact": {
      "name": "Mike Ralphson",
